ALTER TABLE rental_orders ALTER COLUMN manager_id DROP NOT NULL;

INSERT INTO rental_orders (order_number, client_id, status, start_date, end_date, days_count, kit_count, spare_receiver_count, transmitter_count, microphone_count, is_charged, price_per_unit, total_price, prepayment, receiver_notes, manager_id, manager_name, created_at, updated_at)
SELECT 1273, c.id, 'issued', '2025-12-20'::date, '2025-12-21'::date, 2, 26, 0, 0, 0, false, 77, 4000, 0, 'В кристалл Катя Ильина Ваучер Кремль и свияжск', NULL, 'Леонид', NOW(), NOW()
FROM rental_clients c WHERE (c.name ILIKE '%Эдик%' OR c.director_name ILIKE '%Эдик%') AND NOT EXISTS (SELECT 1 FROM rental_orders ro WHERE ro.order_number = 1273) LIMIT 1;

